import './App.css';
import Movie from './components/Movies';
import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {


  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<App />} />
          <Route path="movie" element={<Movie />} />
        </Routes>
      </BrowserRouter>


    </div>
  );
}

export default App;
